import React from "react";

function List() {
  return (
    <div>
      <div>
        <ul>
          <li>Demand</li>
          <li>Material Transfer</li>
          <li>Stored Procedures</li>
          <li>Masters</li>
          <li>Transportation</li>
          <li>Payments</li>
        </ul>
      </div>
    </div>
  );
}

export default List;
